export default function Usuarios() {
  return (
    <div className="lista">
        <div className="flex mb-1 gap-3">
            <button className="btn">Todos os usuarios</button> 
            <button className="btn">Barbeiros</button> 
            <button className="btn">Clientes</button> 
            </div>
      <div className="flex justify-around w-full bg-white border-b border-b-black p-1">
        <p className="w-1/4 text-center">Imagem</p>
        <p className="w-1/4 text-center">Nome</p>
        <p className="w-1/4 text-center">Email</p>
        <p className="w-1/4 text-center">Editar</p>
      </div>

      {jsons.map((user) => (
        <div className="flex justify-around items-center w-full border-b border-b-gray p-1 bg-white">
          <img
            className="sm:w-32 sm:h-32 w-12 h-12"
            width={100}
            height={100}
            src={user.imagem}
          ></img>
          <p className="sm:w-32 w-12 text-center flex-wrap">{user.nome}</p>
          <p className="sm:w-32 w-12 text-center flex-wrap">{user.email}</p>
          <div className="sm:w-32 w-12 flex items-center justify-center">
            <button className="btn ">Editar</button>
          </div>
        </div>
      ))}
    </div>
  );
}
